(()=>{"use strict";addEventListener("fetch",(e=>{const t=e.request;"OPTIONS"===t.method?e.respondWith(new Response(null,{status:204,headers:{"Access-Control-Allow-Origin":"*","Access-Control-Allow-Methods":"GET, POST, OPTIONS","Access-Control-Allow-Headers":"Content-Type, Access-Control-Allow-Origin, Access-Control-Allow-Methods, Access-Control-Allow-Headers"}})):e.respondWith(async function(e){const t=await fetch(e);return(new HTMLRewriter).on("head",{element(e){e.append('\n            <meta property="og:title" content="特別なブログ記事のタイトル">\n            <meta property="og:description" content="特別な記事の説明">\n            <meta property="og:image" content="https://gb.huedpaw.com/wp-content/uploads/2023/05/%E7%8F%BE%E5%A0%B4%E3%82%AF%E3%83%9E-225x300.png">\n          ',{html:!0})}}).transform(t)}(t))}))})();